function findDuplicates(arr) {
  const seen = new Set();         // Set to store unique elements
  const duplicates = new Set();   // Set to store duplicate elements

  for (const item of arr) {
    if (seen.has(item)) {
      duplicates.add(item);       // Add to duplicates if item has been seen before
    } else {
      seen.add(item);             // Add to seen if encountering the item for the first time
    }
  }

  return Array.from(duplicates);  // Convert set of duplicates to an array before returning
}
